import React, {useState} from 'react'

export default function Login() {
	const [user, setUser] = useState({
		email: '',
		password: ''
	})



	return (
		<div className='login-page'>
			<form>
				<input type="email" name="email" id="email" required placeholder='Email' value={user.email} />
				
				<input type="password" name="password" id="password" required placeholder='Password' value={user.password} />

				<div className="row">
					<button>Login</button>
				</div>
			</form>
		</div>
	)
}
